 insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '매우 여성적인 스타일입니다. 꼼꼼하고 아기자기한 것<BR>을 좋아하며 사소한 물건에도 정을 잘 주는 소녀와 같<BR>은 심성을 지니고 있다고 볼 수 있겠습니다. <BR><BR>당신을 잘 챙겨주기도 하며 당신을 위해 요리를 하는 <BR>것에 기쁨을 느끼는 사람이겠습니다.<BR>&nbsp;<BR>가정적인 타입으로써 안정감 있는 생활라이프를 추구<BR>하는 사람이 되겠습니다. ', 'F01', '1');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '생김새에서 나타나는 이미지처럼 소탈하면서도 낙천<BR>적이며 여성스러움이 그대로 나타나는 사람이겠으며 <BR>소심하면서 겁이 많아 당신으로 하여금 보호해 주고 <BR>싶은 충동을 느끼게 하는 여성이 되겠습니다. <BR><BR>특징적으로는 사랑하는 사람을 사소한 것 까지 챙겨주<BR>는 것을 좋아하며 관심받기를 원하므로 외로움을 많이<BR>타는 여성이 되겠습니다. ', 'F02', '2');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '톡톡 튀는 감성적인 사람이라 볼 수 있겠으며 센스 있<BR>는 것에 대한 취향이 있으므로 미적인 분야인 패션 영<BR>화 그림에 대해 관심이 많겠습니다. <BR><BR>여성스러우면서도 일상적으로 파워풀한 남성적인 것<BR>에 대해 동경심이 많아서 도전적인 의식이 있는 여성<BR>이겠습니다. ', 'F03', '3');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '대체적으로 무난해 보이지만 개성이 강한 사람이므로 <BR>싫어하는 것과 좋아하는 것이 확실합니다. <BR><BR>사람에게 직접적으로 감정표현을 하지는 않지만 그 표<BR>정에서 알 수 있을 것이며 강요나 무시당하는 것에 대<BR>해 매우 싫어할 만큼 자신감이 확실한 사람이라 볼 수 <BR>있겠습니다. ', 'F04', '4');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '꼼꼼하고 세심한 관찰력이 뛰어난 여성스러운 사람으<BR>로서 주변 사람들과 적극적인 친화력보다는 일단의 관<BR>찰과 적절한 만남의 횟수에 의해 서서히 마음의 문을 <BR>여는 조심성이 강한 성격의 소유자라 볼 수 있겠습니<BR>다. <BR><BR>대체적으로 알뜰하며 일상생활에 생활력이 강하기 때<BR>문에 여성특유의 장점이 많은 여성입니다. ', 'F05', '5');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '전반적인 모든 일에 긍정적인 사고를 하는 여성으로써<BR>왠만해서는 화를 잘 내지 않지만 원칙적인 면이 강합니다.&nbsp;<BR><BR>&nbsp;자신이 싫어하는 일과 좋아하는 일에 대한 구분이 확<BR>실하며 스트레스에 대한 반응은 다소 유난스러우므로 <BR>활력적인 면을 좋아하는 여성임을 알 수 있겠습니다. ', 'F06', '6');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '차분한 것이 특징적이라 볼 수 있겠으며 사물에 대한 <BR>이해력이나 간파를 잘 하는 점이 있습니다. <BR><BR>의외로 냉정한 이성적인 사고를 하기 때문에 사리분별<BR>에 있어서 확고한 기준과 선을 가지고 있습니다. <BR><BR>다만 정에 약해서 외로움을 잘 타는 편기 때문에 모성<BR>애가 풍부한 사람입니다. <BR>', 'F07', '7');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '타인에게는 최대한 예의를 갖추려 하고 친절을 보이는<BR>사람입니다. <BR><BR>다만 실제로는 내면이 약간의 슬픈 면이 있으며 외로<BR>움과 함께 소심함으로 인해 나타나는 열등감이 있겠습<BR>니다. <BR><BR>밝지만 때때로 아무도 모르게 좌절하는 사슴 같은 사<BR>람입니다. ', 'F08', '8');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '다소 엉뚱한 구석이 많습니다. 기분파에 속하며 이런 <BR>면들이 상황에 따라 남성다워 보이는 보이시한 매력으<BR>로 발산되기도 할 만큼 활동력이 강합니다. <BR><BR>그리고 낙천적이면서 복잡한 것을 싫어하기 때문에 자<BR>신이 관심 가는 부분에 상당한 몰두를 하거나 건망증<BR>으로 인해 다른 부분을 망각하기도 합니다. ', 'F09', '9');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '토형의 특징 그대로 전 분야 여러 사람과 적절히 잘 어<BR>울리는 모범적인 사회생활을 하는 사람이라 볼 수 있<BR>겠습니다.<BR>&nbsp;<BR>자신이 해야 할 일과 하지 말아야 할 일에 대해 나름대<BR>로의 선이 확고한 사람이라 볼 수 있겠습니다. <BR><BR>싫어한다 해서 감정을 그대로 드러내지 않는 참을성이<BR>있어서 항상 결례하지 않도록 미리 조심해야 합니다. <BR>', 'F10', '10');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '재미있는 성격이기도 하기 때문에 주변사람을 재미있<BR>게 만들고 웃음을 자아내는 재주가 있다고 볼 수 있습<BR>니다.<BR><BR>재치와 낙천적인 기질이 이 사람의 장점이라 볼 수 있<BR>겠으며 다소 덜렁대는 부분도 있으므로 아쉬운 단점이<BR>되겠습니다. <BR><BR>그러나 이런 모든 것들이 대하기 편안한 장점이 되므<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;로 다가서기 어렵지 않은 사람입니다. ', 'F11', '11');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '발랄한 느낌으로 유쾌한 성격이지만 의외로 까다로운 <BR>면이 많다고 볼 수 있습니다. <BR><BR>특히 상황이 꼬이거나 뜻대로 일이 풀리지 않는 것에<BR>대해서는 다소 히스테릭한 면도 있다고 볼 수 있겠습<BR>니다. <BR><BR>막내와 같은 애교가 있어서 사귀는 데는 반전의 재미<BR>가 있다고 할 수 있습니다. ', 'F12', '12');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '외모와는 다르게 매우 이성적이며 생각이 깊어 조숙해<BR>보이는 경향이 있다고 볼 수 있겠습니다. <BR><BR>상대방의 기분상태에 대해 눈치가 빠릅니다. <BR><BR>상황에 따라 내성적이기도 하고 외향적이기도 한 가변<BR>성이 있어 속을 알 수 없는 면이 있지만 배려심이 있기<BR>때문에 장기적으로 보면 신뢰가 가는 타입이라 볼 수 <BR>있겠습니다. ', 'F13', '13');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '평소에는 조용하고 말이 많은 편이 아니지만 불의를 <BR>못 참는다거나 주변사람을 대신해서 나서는 대의적이<BR>고 강한 면모를 보여주는 강단이 있습니다. <BR><BR>감정표현이나 개인적인 이야기 보다는 객관적인 주제<BR>에 대해서는 열의 있게 참여하고 토론하는 면도 있습<BR>니다. ', 'F14', '14');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '활달한 성격에 넉넉한 심성이 있어 주변 사람들과 잘 <BR>지내는 타입입니다. <BR><BR>배려심이 때로는 지나쳐 스스로 상처를 입기도 하지만<BR>긍정적인 사고를 하기 때문에 빨리 털어버리는 타입입<BR>니다. <BR><BR>다만 인간적인 측면에서 실망을 느낄 때가 더 크게 상<BR>심하는데 한번 실망한 대상에게는 단호한 면을 보이기<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 도 합니다. ', 'F15', '15');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '약간 덜렁대기도 하며 동안 특유의 애교스러운 부분이<BR>잘 발달한 여성입니다. <BR><BR>때로는 당신을 약 올린다거나 괜한 장난을 걸기도 하<BR>지만 의외로 소심하고 상처를 잘 받는 여린 심성의 소<BR>유자라 볼 수 있겠습니다. <BR><BR>겉보기엔 강해 보이는 면이 있지만 어쩔 수 없는 여성<BR>이기 때문입니다. ', 'F16', '16');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '발랄하며 도전적인 성격과 더불어 빈틈없는 자기관리<BR>가 돋보이는 여성입니다. <BR><BR>또한 남자에 대한 경계와 더불어 타인의 도움을 쉽게 <BR>받으려 하지 않으므로 다소 공략이 어려울 수 있겠지<BR>만 한번 믿는 사람은 확실히 믿는 타입입니다. ', 'F17', '17');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '무엇이든 얽매이는 것을 싫어하며 자신이 하는 일을 <BR>꾸준히 찾아 나서고자 합니다. <BR><BR>남자와 단란함보다도 자신의 일에 대한 성공이 우선이<BR>라 생각한다고 볼 수 있겠으며 어떤 면에서는 다소 패<BR>쇄적인 면도 있어 쉽게 다가서기 어려운 쌀쌀함도 엿<BR>보이는 성격이라 볼 수 있겠습니다. ', 'F18', '18');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '다소 시니컬한 내성적인 성격의 소유자라 볼 수 있겠<BR>습니다. <BR><BR>크게 감정의 변화가 없어 보이지만 감성적인 내면이 <BR>있어 고상한 개인적인 취미에 관심을 많이 두기도 합<BR>니다. <BR><BR>자신의 단점을 보여주기를 매우 싫어하며 여럿이 다니<BR>는 것을 꺼려하는 면도 있습니다. ', 'F19', '19');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '여유롭고 활발한 성격에 주변 사람과 잘 어울리지만 <BR>때때로 자기중심적인 면이 강하기 때문에 자신과 마음<BR>이 잘 맞는 사람과 의기투합을 잘하기도 합니다. <BR><BR>여느 여성처럼 소심하거나 새침하기보다는&nbsp;털털한 타<BR>입에 속하기 때문에 격식을 잘 따지지는 않습니다. <BR>', 'F20', '20');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '단정하고 빈틈없어 보이는 성격 그대로 일상생활에는 <BR>완벽주의적인 면이 많이 나타나지만 실상 자신의 개인<BR>적인 부분에 있어서는 의외로 많이 털털한 타입입니<BR>다.<BR><BR>대충 차려입고 티브이를 시청하거나 슬리퍼차림인 경<BR>우도 많으므로 외면적인 부분에 남자들이 쉽게 다가서<BR>지 못하는 단점이 있는 타입이라 볼 수 있겠습니다. ', 'F21', '21');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '수수한 성격에 그다지 까다롭지 않은 푸근함이 장점이<BR>라 볼 수 있겠습니다. <BR><BR>웃음이 평소에 많지만 애교나 농담을 하는 것에 대해 <BR>익숙하지 않아서 크게 재미는 없을 수 있다고 볼 수 있<BR>겠습니다. <BR><BR>과자로 치면 화과자가 아닌 쌀과자와 같은 담백한 것<BR>이 되겠습니다. ', 'F22', '22');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '유들유들한 성격에 많은 사람들과 허물없이 지내는 여<BR>성입니다. <BR><BR>웃음이 많으며 천진난만한 기질이라 대인관계가 넓습<BR>니다. <BR><BR>대체적으로 자신의 주변 사람들에게 잘 베푸는 넉넉한<BR>심성이 장점이며 이따금 덜렁대는 특성이 있어 약간의<BR>일말의 단점이 있기도 하겠습니다. <BR>', 'F23', '23');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '깔끔한 성격에 주변 사람들을 잘 챙기는 것이 특징이<BR>라 볼 수 있겠으며 자제력이 강하기 때문에 대체적으<BR>로 자신의 위치를 잘 지키는 단호한 면이 있겠습니다. <BR><BR>단체생활이나 사회생활에 있어서 적당한 선을 유지하<BR>려 노력하는 노력파며 남자에 대해서는 다소 기대치가<BR>높은 것이 흠입니다. ', 'F24', '24');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '화통한 성격이며 의리가 있는 시원한 성격의 소유자라<BR>볼 수 있겠습니다. <BR><BR>그러나 쉽게 마음에 상처를 입고 티를 내지 못하는 소<BR>심함이 있어 가끔 덩치에 어울리지 않는 여린 면이 있<BR>기도 하겠습니다. <BR><BR>대체적으로 자신보다는 남을 위해 노력하는 순수한 면<BR>이 많은 사람이라 볼 수 있겠습니다. ', 'F25', '25');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '아기 같은 순수함과 함께 약간 맹한 느낌의 백치미가 <BR>엿보이는 타입입니다. <BR><BR>눈치가 다소 느린 편이라 그러하며 가끔 엉뚱한 행동<BR>이나 말로 당신을 깜짝 놀라게 하지는 않을까 합니다. <BR><BR>다만 자신의 일에 대해서는 매우 노력하고 숙련된 솜<BR>씨를 보여 주므로 절대 지능이 낮은 사람은 아니라는 <BR>것을 알 수 있습니다. 자신이 좋아하는 것에 지나친 몰<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 두를&nbsp;하기 때문일 뿐입니다. ', 'F26', '26');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '겉으로는 조용해 보이지만 보기와는 다르게 강한 성격<BR>의 소유자로 자기 자신에 대한 표현은 딱 부러지게 하<BR>는 여성입니다. <BR><BR>상냥하고 조용한 성격이면서 동시에 싫어하는 것과 그<BR>렇지 않은 것에 대해 분명히 하는 타입이므로 매사에 <BR>당당해 보이며 긍정적인 사고를 하는 사람입니다. ', 'F27', '27');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '수수한 셩격에 배려심이 깊은 타입의 여성이라 볼 수 <BR>있겠습니다. <BR><BR>낙천적이며 긍적적인 사고를 하며 조용히 지내기를 좋<BR>아합니다. <BR><BR>친구는 많아도 몰려다니며 놀거나 소비지향적인 것은 <BR>싫어하며 남는 시간에는 문화생활에 좀 더 투자하고자<BR>하는 스타일이라 볼 수 있겠습니다. ', 'F28', '28');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '생기발랄하며 다소 덜렁대는 면이 있겠습니다. 쾌활한<BR>성격에 활동적인 것을 좋아하며 답답한 것을 싫어하는<BR>편입니다. <BR><BR>편안히 쉬는 것 보다는 여행을 가거나 움직이며 스트<BR>레스를 해소하기를 더 좋아하는 타입이며 막내 같은 <BR>타입에 애교가 많은 여성이겠습니다. ', 'F29', '29');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '일상적으로 재치 있는 타입이며 상대방에 대해 유심히<BR>관찰하는 여유로움이 있는 타입입니다. <BR><BR>전반적으로 자신의 관심사에 대해 호기심을 잘 나타낸<BR>다고 볼 수 있겠으며 좋아하는 물건에 대해 집착하거<BR>나 수집하는 취미를 통해 호기심과 의욕이 많은 사람<BR>이라는 것을 알 수 있겠습니다. ', 'F30', '30');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '밝고 쾌활한 성격이며 아기자기한 것을 좋아하는 여성<BR>적인 면이 많은 사람입니다. <BR><BR>소녀티가 많이 남아있는 편이기도 하며 천성적으로 순<BR>진한 면이 많은 타입이라 볼 수 있겠습니다. <BR><BR>애교가 남다른 면이 있으며 상대방을 챙겨주는 것을 <BR>매우 좋아하는 타입입니다. ', 'F31', '31');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '넉넉한 인상처럼 여유로운 성격이지만 게으르거나 나<BR>태하지는 않으며 낙관론자로써 인생을 각박하게 살기<BR>보다는 즐기면서 살고 싶어 하는 타입이 되겠습니다. <BR><BR>자신이 여유로우면 남을 도울 줄도 알며 타인의 이야<BR>기를 잘 들어 주는 자상한 면이 장점이 되겠습니다. ', 'F32', '32');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '자신의 개성이 강한만큼이나 주관이 강하며 일반적으<BR>로 외향적인 분위기를 느낄 수 있지만 실제로는 내성<BR>적인 타입이라 볼 수 있겠습니다. <BR><BR>지기 싫어하는 승부욕으로 인해 다소 오버된 면모가 <BR>있지만 마음이 여리고 자신을 방어하는데 충실한 내성<BR>적인 타입이라 정의할 수 있겠습니다. ', 'F33', '33');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '조용하면서도 다소 엉뚱한 면이 있어 주변사람으로부<BR>터 관심을 끄는 면도 있습니다. <BR><BR>의외의 발상이나 의외의 행동이 약간 귀여워 보이거나<BR>색다른 모습으로 보일 수도 있겠습니다. <BR><BR>80%는 차분해 보이지만 20%정도는 약간의 엽기로 구<BR>성된 미스테리함이 그녀의 매력적인 부분이&nbsp;될 것 입<BR>니다. ', 'F34', '34');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '차분하며 내성적인 타입이라 볼 수 있겠습니다. 잔잔<BR>한 성격이지만 사랑이라는 감정을 느끼면 과감해지는<BR>면도 있겠습니다. <BR><BR>주관이 뚜렷하기 때문에 약해 보이지만 결코 약한 사<BR>람은 아니기에 외유내강이라는 표현이 잘 어울리는 사<BR>람이라 볼 수 있습니다. ', 'F35', '35');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '단순명료한 것을 좋아하며 딱 부러지는 성격이 있겠습<BR>니다. 그러나 연애에 있어서는 오히려 어설프거나 세<BR>련되지 못한 모습을 보일 수도 있습니다. <BR><BR>감정표현에 있어서 솔직하다기 보다는 이런 부분에서 <BR>부끄러움을 많이 타기 때문일 것입니다. ', 'F36', '36');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '한마디로 표현하기에는 약간 어려움이 있는 사람입니<BR>다.<BR>&nbsp;<BR>대체적으로는 내성적이라 볼 수 있겠습니다만 잔잔한 <BR>성격이면서 동시에 사랑이라는 감정을 느끼면 과감해<BR>지는 면도 있기 때문입니다. <BR><BR>자신이 하고자 하는 일은 꼭 추진하는 사람이겠습니<BR>다. ', 'F37', '37');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '일반적으로 부드럽고 상냥함을 보여주는 편이며 여성<BR>특유의 친절함이 장점이라 볼 수 있습니다.<BR>&nbsp;<BR>그러나 이러한 유연한 모습과 함께 명료하고 확실한 <BR>것을 추구하는 단호함을 갖추고 있어 대조적인 면도 <BR>있어 나약하지만은 않은 여성임을 알 수 있겠습니다. ', 'F38', '38');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '자신의 주관이 뚜렷하며 의욕적인 사람입니다. 대인관<BR>계는 원활하며 여러 분야의 사람들과 교분을 맺기를 <BR>좋아합니다. <BR><BR>사회활동에 능숙한 타입의 여성이라 볼 수 있겠습니<BR>다. <BR><BR>독립에 대한 욕심이 강한 편이며 여성이지만 일적으로<BR>는 카리스마가 넘치는 당찬 모습과 개인적으로는 여성<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 다운 센스를 갖춘 여성이라 볼 수 있겠습니다. ', 'F39', '39');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '기분파에 속하는 타입입니다. 시원시원한 성격이라 주<BR>변엔 선후배가 많겠으며 여러 사람과 어울려 파티를 <BR>하거나 모임을 가지는 것을 좋아하겠습니다. <BR><BR>어느 정도 다혈질적인 면이 있지만 생활력이 강한 것<BR>이 장점입니다. ', 'F40', '40');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '일이나 학문이나 자신이 하고자 하는 일에 대한 욕심<BR>이 많은 의욕적인 여성이겠습니다. <BR><BR>꿈을 실현하기 위해 노력하며 배우기를 주저하지 않는<BR>사람이라 볼 수 있겠습니다. <BR><BR>이성적이고 논리적인 사고를 하는 여성이지만 상대적<BR>으로 애교는 다소 부족할 수 있겠습니다. ', 'F41', '41');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '어딘가 모르게 차분하며 내성적인 면이 있는 사람입니<BR>다. <BR><BR>전반적으로는 갑작스러운 것을 좋아하지 않지만 애정<BR>문제 만큼은 다소 정열적인 면이 나오기도 합니다. <BR><BR>감수성이 풍부해서 여성특유의 애교스러움이 장점이 <BR>되겠으며 배려심이 깊어 편안한 사람이라 볼 수 있겠<BR>습니다. ', 'F42', '42');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '겁이 많고 섬세하고 부드러움이 장점이므로 여성적인 <BR>매력이 강한 사람이겠습니다. <BR><BR>특히나 웃음이 많은 편이며 소녀와 같은 감수성이 오<BR>래도록 남아 있어 부드러운 여성적인 매력이 잘 살아<BR>나는 타입의 여성입니다. ', 'F43', '43');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '둥글둥글한 얼굴에 재치 넘치는 화법이 기대되는 여성<BR>입니다. 시원한 성격에 남을 즐겁게 해 주는 재치도 있<BR>는 여성입니다. <BR><BR>그러나 한 번씩 화가 나거나 슬픈 일에는 의외로 크게 <BR>반응하는 소심한 구석도 있겠으며 의외로 쉽게 상처를<BR>받기도 한다는 점입니다. <BR><BR>다만 그런 면들을 쉽게 드러내지 않는 않겠습니다. ', 'F44', '44');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '여성스러운 면이 강한 타입입니다. 아기자기한 것을 <BR>좋아하는 습성이 있어서 어린 소녀처럼 인형을 선물만<BR>받아도 감동할 수 있는 사람입니다.<BR>&nbsp;<BR>그러나 약간 엽기적인 구석도 있겠습니다. 가끔씩 엉<BR>뚱한 발상이나 당돌해 보이는 면을 가지고 있기 때문<BR>에 신선한 매력이기도 합니다. ', 'F45', '45');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '시원시원하며 화통한 성격이라 볼 수 있겠습니다. <BR><BR>기본적으로 웃음이 많습니다 여럿이서 함께 어울려 놀<BR>거나 파티를 하는 것을 즐거워하는 기분파라 볼 수 있<BR>겠습니다. <BR><BR>다만 감정기복이 있기 때문에 슬픈 일이 있거나 우울<BR>할 때엔 혼자 시간을 보내며 상처를 어루만지기도 합<BR>니다. ', 'F46', '46');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '조용하고 다소곳한 경우가 많아서 여성적이고 싹싹한 <BR>이미지를 연출합니다. <BR><BR>그렇지만 소심하다거나 내성적이라 볼 수는 없으며 어<BR>울려 놀기를 좋아하므로 이런 순간에는 상당히 외향적<BR>인 모습을 보여주곤 하기 때문에 전체적으로 발달한 <BR>다혈질적인 성격입니다. ', 'F47', '47');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '발랄하고 쾌활한 성격입니다. 웃음이 많은 타입입니<BR>다. 매사에 의욕적이며 호기심이 많은 타입이겠습니<BR>다. <BR><BR>주변에 사람들도 많지만 때로는 혼자 있으려 노력하는<BR>때가 종종 있겠습니다. <BR><BR>외로움을 곧잘 타며 감수성이 풍부하기 때문에 슬프거<BR>나 우울할 때면 다른 사람에게 이런 모습을 보여 주지 <BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 않으려 하기 때문입니다. ', 'F48', '48');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '조용조용하고 차분한 타입의 내성적인 성격의 소유자<BR>입니다. <BR><BR>긍정적이고 여성스러운 사람이지만 때로는 사소하고 <BR>별것 아닌 일에 민감한 반응을 나타내고 심하면 히스<BR>테릭 해 질수도 있습니다. <BR><BR>외로움을 많이 타기 때문에 듬직한 남성과의 연애를 <BR>통해 이런 부분들이 완화되기도 합니다. ', 'F49', '49');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '심각한 것이 없는 낙천적인 성격이기도 하지만 다소 <BR>심한 부분이 있어 배짱이 두둑해 보이기도 하며 여유<BR>롭게 세상을 살아가는구나 하는 느낌을 받을 수도 있<BR>다고 볼 수 있겠습니다. <BR><BR>항상 좋은 쪽으로 결론이 나길 바라며 그렇지 않으면 <BR>빨리 잊으려 노력하는 타입이라 볼 수 있기 때문입니<BR>다. ', 'F50', '50');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '밝은 성격이지만 낯가림을 곧잘 하며 낮선 사람과 낮<BR>선 환경에 대해서는 당분간 적응이 필요한 스타일입니<BR>다. 소심하거나 내성적이지는 않습니다. <BR><BR>수줍은 면이 많아 목소리가 작아지기도 하겠지만 친해<BR>지면 금방 컨디션을 회복하고 쾌활한 모습을 보여주기<BR>도 합니다. ', 'F51', '51');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '머리가 좋은 만큼 재치도 뛰어난 사람입니다. 언변이 <BR>뛰어 나며 톡톡 튀는 면이 있어 주변을 즐겁게 하며 여<BR>러 사람들에게 싹싹하게 대하기 때문에 인기도 있다고<BR>볼 수 있겠습니다. <BR><BR>그러나 신경을 많이 쓰기 때문에 다소 히스테릭한 반<BR>응을 보일 때도 있겠습니다. ', 'F52', '52');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '조용조용한 성격에 차분한 기질이 강하게 나타납니다.<BR>여러 가지에 대한 생각이 많고 산만하면서도 때때로 <BR>강한 집중력을 보이기도 합니다 <BR><BR>오랫동안 고민하는 신중한 성격을 소유하고 있기 때문<BR>입니다. 대인관계는 넓으면서도 그다지 사람을 만나는<BR>것에 대해 좋아하지는 않습니다. ', 'F53', '53');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '차분한 가운에 정열적인 혈기가 왕성한 사람입니다. <BR>조용조용하면서도 적극적이며 힘들어도 물러서지 않<BR>는 꿋꿋한 의지가 돋보이는 여성입니다. <BR><BR>대인관계는 공적으로는 넓다고 볼 수 있겠지만 개인적<BR>으로는 마음을 열 상대가 없어 군중속의 외로움을 많<BR>이 느끼며 생활했을 것입니다. ', 'F54', '54');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '자기의지가 강한 사람이며 도전하기를 좋아하는 타입<BR>입니다. <BR><BR>대인관계도 원만한 편이며 활동적이기 때문에 대체적<BR>으로 생동감이 느껴지는 면이 크지만 상대적으로 정서<BR>가 불안한 듯한 면도 있다고 볼 수 있겠습니다. <BR><BR>가만히 집중을 하는 일이나 신중을 필요로 하는 경우<BR>엔 어려워 할 수 있겠습니다. ', 'F55', '55');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '대체적으로 덜렁댄다거나 성급한 면이 지배적인 타입<BR>이라 볼 수 있겠습니다. <BR><BR>가만히 머물러 있기보다 쉴새 없이 움직이며 활동하기<BR>를 좋아하는 타입이라 볼 수 있겠습니다. <BR><BR>순수하면서도 애기 같은 면이 많아 별 것 아닌 일에도 <BR>투정이나 질투를 보이는 면도 있다고 볼 수 있겠습니<BR>다. ', 'F56', '56');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '신뢰를 중요시 하는 성격이며 단체생활에 적합한 규격<BR>적인 성격이라 볼 수 있겠습니다. <BR><BR>요령이 약간 부족한 없지 않으며 자신의 위치와 상대<BR>방의 위치에 따라 서로의 질서를 지키며 살아가고자<BR>하는 이상적인면이&nbsp;큽니다.<BR>&nbsp;<BR>단호함과 강한 생활력이 있기 때문에 장래가 긍정적인<BR>사람이라 평할 수 있겠습니다. ', 'F57', '57');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '밝고 낙천적인 성격의 소유자이며 천진난만한 소녀와 <BR>같은 매력이 돋보이는 타입이겠습니다. <BR><BR>개성이 뚜렷하고 남에게 지기 싫어하는 승부욕이 그녀<BR>를 움직이게 하는 원동력입니다. <BR><BR>다만 외로움을 잘 타기 때문에 여성스러움도 잘 살아 <BR>있으며 가정적인 충실도나 모성애도 강한 편입니다. ', 'F58', '58');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '외모는 다소 화려하고 세련되어 보일 수 있겠지만 본<BR>래의 성격은 단순하고 심플한 것을 좋아하는 털털한 <BR>성격의 소유자입니다. <BR><BR>조급한 것 보다는 여유를 즐기며 휴식을 취하는 것을 <BR>좋아하며 여러 가지에 관심을 가지며 배우기를 좋아합<BR>니다. <BR><BR>때로는 단순한 기질로 인해 약간 백치미가 느껴지는<BR>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 부분도 있다고 볼 수 있겠습니다. ', 'F59', '59');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '차분하며 신중한 성격에 해당됩니다. 주변에 아는 사<BR>람은 많지만 그다지 사교적이지는 않다고 보여 집니<BR>다. <BR><BR>대개 혼자 있는 것을 좋아하며 번잡스러운 것을 싫어<BR>하기 때문에 보통 단 둘이서의 만남이 아니면 모임자<BR>리에서 일찍 자리에 뜨려하는 습성도 있을 것입니다. <BR><BR>화가 나면 말문을 닫아버리는 점도 특징이라 할 수 있<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 겠습니다. ', 'F60', '60');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '다소 산만하고 성급한 면이 있지만 도전적인 기질이 <BR>엿보이는 활동적인 여성입니다. <BR><BR>센스가 잘 발달하였기에 재치 있는 입담과 감정에 따<BR>라 다양하게 반응하는 스타일이라 볼 수 있겠습니다. <BR><BR>표정에서 자신의 감정 상태를 잘 나타내고 있는 것이 <BR>특징적인 부분에 속합니다. ', 'F61', '61');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '도전적인 타입으로 무시당하는 것을 싫어합니다. 생활<BR>력이 강하며 선후배간의 대인관계가 잘 발달한 사람입<BR>니다. <BR><BR>인간관계는 원만하지만 좋고 싫은 것이 확실하기 때문<BR>에 자신과 잘 맞는 사람하고는 잘 뭉치며 그렇지 않은 <BR>사람과는 교류를 단절하고자 하는 특성이 있다고 볼 <BR>수 있겠습니다. ', 'F62', '62');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '낙천적이면서도 잔잔한 성격의 소유자라 할 수 있겠습<BR>니다. <BR><BR>크게 모나지 않은 성격이라 누구에게나 친절하고 배려<BR>심 깊은 타입의 여성이라 볼 수 있겠습니다. <BR><BR>다만 화가 나거나 흥분한 상태에서는 매우 강한 면모<BR>를 보여주기도 하므로 결코 온순하기만 하지는 않습니<BR>다. ', 'F63', '63');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '쾌활한 성격에 활동적인 기질이 잘 발달한 여성입니<BR>다. <BR><BR>다소 성급한 면이 있어 신중하지 못한 점이 있지만 생<BR>활력이 강하며 타인에게 피해를 주지 않으려 노력하는<BR>사람입니다. <BR><BR>단점이라면 아침잠이 많아서 다소 게으른 면이 있겠습<BR>니다. ', 'F64', '64');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '생긴 모습만큼이나 확실한 것을 좋아하며 불분명하거<BR>나 애매한 것은 배척하기도 합니다. <BR><BR>그런 영향으로 다소 성급한 면이 없지 않지만 긍정적<BR>이며 타인을 존중하고 배려할 줄 압니다. 일상적인 사<BR>회생활에 잘 적응하는 발전적인 여성입니다. ', 'F65', '65');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '머리회전이 빠른 편이며 흥미로운 것에는 굉장한 집중<BR>력을 발휘하는 스타일입니다.. <BR><BR>그러나 일반적인 것에는 심드렁하며 귀찮아하기 까지 <BR>하기 때문에 상황이나 여건에 따라 보여 지는 모습은 <BR>다소 극단적인 대비를 이룰 수 있습니다. <BR><BR>관심 있는 일에는 적극적이며 그렇지 못한 때에는 소<BR>극적이라 볼 수 있겠습니다. ', 'F66', '66');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '상대방을 놀리기도 하며 칭찬을 하기도 하는 등의 재<BR>치 있는 입담이나 행동이 매력적인 타입이겠습니다. <BR><BR>상황이나 차림새에 따라 매우 여성스러운 면도 많이 <BR>나타나지만 의외로 남성다운 강인한 이미지를 표출하<BR>는 보이시한 성격이 대비를 이루는 여성입니다. <BR>', 'F67', '67');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '쾌활하고 활동적인 면과 동시에 잔잔한 호수와 같은 <BR>면을 동시에 지닌 신비로운 분위기를 지닌 여인입니<BR>다. <BR><BR>상황에 맞게 행동을 할 줄 아는 센스가 있기 때문이라 <BR>판단합니다. 원래의 성격이라면 다소곳하고 조용한 것<BR>을 좋아하는 분위기파라 볼 수 있겠습니다. ', 'F68', '68');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '아기자기한 것을 좋아하는 전형적인 여성스러운 성격<BR>의 소유자라 볼 수 있겠습니다. <BR><BR>귀엽고 깜직한 것이나 여성스러운 물건등을 좋아하며 <BR>이러한 주제로 수집을 하는 등의 취미도 예상할 수 있<BR>겠습니다. <BR><BR>소심한 편이기 때문에 주변사람에게 의지하고자 하는<BR>&nbsp;부분이 크다고 볼 수 있겠습니다. ', 'F69', '69');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '겉으로는 와일드해 보이기도 하며 무언가 노련하고 눈<BR>치도 빠를 것처럼 느껴지지만 사실은 다소 단순하고 <BR>푼수 같은 기질의 백치미가 매력인 여성입니다. <BR><BR>머리가 나쁘다는 의미는 아니지만 건망증이 좀 있으며<BR>덜렁대기 때문에 이러한 이미지가 겹친다는 의미는 아<BR>니겠습니다. ', 'F70', '70');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '차분하며 조용한 성격의 소유자라 볼 수 있겠습니다. <BR>화들짝 놀라서나 감정의 기복이 심한 경우를 자주 목<BR>격하기는 어려울 것입니다. <BR><BR>이러한 면들이 다소 조숙하다거나 세상살이를 달관한 <BR>것처럼 보이기도 하지만 원래 생각이 많아 모든 경우<BR>에 대해 여러 가지 생각을 하기 때문이라 볼 수 있겠습<BR>니다. ', 'F71', '71');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '딱 부러지는 자기 주관에 강한 고집이 있지만 여성특<BR>유의 여린 마음이 있기 때문에 굉장히 방어적인 면이 <BR>강한 타입이라 볼 수 있겠습니다. <BR><BR>정이 깊은 면이 있어서 상처도 잘 받습니다. <BR><BR>이러한 점에서 쉽게 정을 주지 못합니다. 생활력이 강<BR>하며 의지가 강하기 때문에 이러한 점이 쉽게 드러나<BR>지는 않을 뿐입니다. ', 'F72', '72');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '외모에 비춰보면 매우 딱딱해 보이며 빈틈이 없어 보<BR>이기도 하지만 일상적인 경우는 이와는 거리감이 있겠<BR>습니다. <BR><BR>자유롭고 털털한 분위기를 선호하며 가식이나 허례허<BR>식 따위는 오히려 싫어합니다. <BR><BR>남녀를 떠나 스스럼없이 잘 어울리기 때문에 편안한 <BR>자리와 편안한 사람을 좋아한다고 볼 수 있습니다. ', 'F73', '73');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '매력적이며 여성스러운 면이 잘 발달해 있기 때문에 <BR>꼼꼼하며 주변사람을 잘 챙겨주는 스타일입니다. <BR><BR>심리적으로 민감한 반응을 하기 때문에 적당히 튕기거<BR>나 내숭을 부리는 것이 매력포인트라고 할 수 있겠습<BR>니다. ', 'F74', '74');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '잔잔하며 차분한 성격입니다. 깊은 심연처럼 속을 알<BR>기 어려운 과묵한 점과 적당히 주변의 분위기에 맞춰<BR>주는 센스로 크게 무리 없는 사회생활을 유지해 나가<BR>는 정도입니다. <BR><BR>심란하면 특히 과묵해 지며 주변의 방해를 피하고자 <BR>하기 때문에 혼자 다니는 것이나 여행을 하는 것도 좋<BR>아합니다. ', 'F75', '75');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '톡톡 튀는 신세대적인 면이 많습니다. 자기주관이 뚜<BR>렷하기 때문에 싫은 것과 좋은 것에 대해 거침없이 말<BR>할 줄 아는 당찬 면이 있습니다. <BR><BR>전반적인 대인관계도 이런 영향으로 구성되어 있다고 <BR>볼 수 있겠으며 의리를 중요하게 생각하기 때문에 배<BR>신을 하거나 실망을 안겨주는 것을 꽤 싫어한다고 볼 <BR>수 있겠습니다. ', 'F76', '76');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '낙천적이며 오랫동안 고민하기를 싫어하는 긍정적인 <BR>사고의 소유자라 볼 수 있겠습니다. <BR><BR>아니다 싶은 것은 미련을 남기지 않으려 하며 자신에<BR>게 도움이 되는 것은 적극적으로 받아들이려 노력하는<BR>타입이라 볼 수 있겠습니다. <BR><BR>그런 만큼 대인관계도 원활하며 적극적이라 할 수 있<BR>지만 직선적인 말투로 인해 때로는 적을 만들 수도 있<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;겠습니다. ', 'F77', '77');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '부드럽고 차분하면서 지적인 분위기가 강한 타입입니<BR>다. 새로운 것에 대한 경험이 부족하기 때문에 낮선 세<BR>계에 대한 동경은 있지만 모험을 하기는 싫어합니다. <BR><BR>잔잔한 웃음이 매력적이면서도 주변사람을 저절로 마<BR>음이 편해지는 넉넉함을 지닌 여성입니다. ', 'F78', '78');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '약간 부정적인 듯 한 말투와 까칠한 가시가 돋아난 장<BR>미와 같은 성격이라 볼 수 있겠습니다. <BR><BR>반항아적인 기질이 강하고 예민하기 때문에 감정기복<BR>이 심할 수 있습니다. 생리하는 날이나 날씨가 변덕스<BR>러울 때에는 덩달아 우울해 지거나 예민해지는 변화가<BR>있겠습니다. ', 'F79', '79');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '겉보기와는 다르게 다소 투박하며 약간 중성적인 기질<BR>이 강한 소탈한 여성입니다. <BR><BR>직업적인 특성이나 남자 선후배가 많아서 그런 특성이<BR>잘 형성되었다고 볼 수 있겠습니다. <BR><BR>다만 은은한 매력과 애교가 있기 때문에 오히려 보이<BR>쉬한 매력이 잘 살아나는 여성이라 볼 수 있겠습니다. ', 'F80', '80');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '깔끔한 인상과는 달리 신중하면서도 털털하고 여러 사<BR>람과 교분을 잘 이끌어가는 편입니다. <BR><BR>다만 능동적이라기보다는 매사에 일단 먼저 생각해 보<BR>고 움직이는 스타일이기 때문에 수동적으로 보이기도 <BR>하지만 신중한 면이 장점이다 하겠습니다. <BR><BR>말이 많지 않으며 핵심을 간파하는 예리함을 가진 사<BR>람입니다. ', 'M01', '81');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '크게 모난 것이 없는 사람이며 전반적인 부분에 걸쳐 <BR>원만함을 보여주는 사람입니다. <BR><BR>패션이나 주변 외양은 털털한 듯한 모습을 하고 있고 <BR>또 그러한 것을 좋아하는 것으로 보여 질지도 모르지<BR>만 의외로 깔끔하고 심플한 것을 추구하는 면이 매력<BR>적인 인물입니다. ', 'M02', '82');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '싫어하는 것과 좋아하는 것에 대한 구분이 확실합니<BR>다. 매사에 질질 끄는 거라거나 애매모호한 것을 매우 <BR>답답해하며 싫어합니다. <BR><BR>낙천적이면서도 활동적이고 적극적인 특성이 돋보이<BR>는 남자다움을 가지고 있습니다. 그래서 그의 주변에<BR>는 따르는 친구가 많을 것입니다. ', 'M03', '83');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '털털한 성격에 주변 사람들과 잘 어울리지만 자신의 <BR>속마음을 쉽게 내비치지 않는 신중함이 있는 면이 있<BR>습니다. <BR><BR>문화적인 것을 좋아하는 경향이 있어 여행이라거나 영<BR>화에 대해 많은 관심이 있습니다. <BR><BR>사소한 것에도 정을 주는 면이 이 사람의 소탈함을 잘 <BR>대변하고 있다고 볼 수 있겠습니다. ', 'M04', '84');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '논리적이고 확실한 것을 좋아합니다. 주변의 다양한 <BR>분야 사람들과 교류하기를 좋아하고 미식가이며 건강<BR>에 대한 관심이 높은 편입니다. <BR><BR>어떤 부분에서든지 지는 것을 싫어하며 은근히 활동적<BR>인 것에 대해 좋아하는 편이라 볼 수 있습니다. <BR><BR>리더쉽이 강한 편이어서 애정관계에 있어서 남성다운 <BR>면을 유감없이 보여주는 타입입니다. ', 'M05', '85');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '원활한 대인관계를 지향하는 타입이며 활동적인 것을 <BR>좋아하는 스타일이라 주변에는 친구가 항상 많습니다. <BR><BR>스포츠나 여행 조립 수집과 같은 취미가 있을 경우가 <BR>많습니다. <BR><BR>여럿과 모이는 것을 좋아하는 특성이 있어 연애하는데<BR>그 주변사람들의 눈치를 봐야 하는 경우가 있을 수 있<BR>으므로 초반엔 다소 어려움이 있기도 하겠습니다. ', 'M06', '86');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '직선적일 때에는 주변에 공격적인 자세를 취하기도 하<BR>지만 일의 처리에는 속도감이 있는 편입니다. <BR><BR>일과 연관된 부분에 있어서는 지기 싫어하는 근성이 <BR>있기 때문이지만 여성에게는 부드럽게 대하는 편입니<BR>다. <BR><BR>저돌적이면서 자아의 이상실현에 대한 의욕이 대단한 <BR>사람이라 볼 수 있습니다. ', 'M07', '87');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '겉으로 보기에 차분한 듯 하면서도 자신이 좋아하는<BR>것이나 흥미로운 주제를 만나면 열정적인 모습을 보여<BR>주는 등의 흥분한 상태를 나타내기도 하는 활력적인 <BR>스타일의 남자입니다. <BR><BR>전반적인 행동은 일관성을 가지고 생활에 임하는 편이<BR>므로 사귀는 동안 이 남자에 대해 가끔씩 의외의 매력<BR>을 느낄 만합니다. ', 'M08', '88');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '대체적으로 시니컬한 반응을 보여주기 쉽습니다. 자신<BR>과 상대방에 대한 경계선을 미리 확고히 하는 편이기 <BR>때문에 따끔거리는 바늘과 같은 기질을 가진 남성이라<BR>봅니다. <BR><BR>일단 두고 보다 기회다 싶으면 놓치지 않고 상대방의 <BR>약점을 공략하는 매서움과 은연중에 챙겨주는 부드러<BR>움이 공존하는 남자입니다. ', 'M09', '89');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '겉의 이미지와 마찬가지로 재치만점인 재담과 익살이<BR>돋보이는 사람이입니다. <BR><BR>주변 사람으로부터 의외일 정도의 인기를 얻고 있는 <BR>비결은 외모가 아니라 낙천적인 성격에서 나타나는 재<BR>치가 이유입니다. <BR><BR>웃음이 많은 편이라 당신의 근심을 적절하게 잊게 할 <BR>수 있는 부분이 장점이라 볼 수 있습니다. ', 'M10', '90');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '세련된 언어를 구사하거나 행동하는 데에 있어 전체적<BR>으로 매너가 있다는 느낌을 주지만 상황에 따라서는 <BR>털털하고도 익살스러움을 보여주는 사람이입니다. <BR><BR>의외의 구석이 많은 편이기도 하므로 가까이 지낼수록<BR>연구대상이 되기도 하는 재미있는 성격의 소유자라 할<BR>수 있겠습니다. ', 'M11', '91');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '인상에서 나타나는 대로 타인에 대한 배려가 기본적으<BR>로 갖춰진 사람이겠지만 자존심이 무척 강한 부분이 <BR>있기 때문에 우선적으로 이 사람에 대한 파악을 한 후 <BR>적절한 대처가 필요합니다. <BR><BR>낙천적이지만 자존심에 상처가 생기면 의외로 우울한 <BR>모습이 나타나는 것이 특징입니다. ', 'M12', '92');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '인상과 마찬가지로 활동적인 성격으로서 스포츠를 좋<BR>아하고 여행에 흥미를 가진 경우가 많습니다. <BR><BR>무엇이든 도전하고 땀을 흘리기 좋아하는 남성적인 취<BR>미를 가졌거나 그러한 행동이 나타나는 스타일입니다. <BR>대체적으로 주변에 친구나 선후배가 많고 인물됨이 호<BR>방한 편입니다. ', 'M13', '93');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '평화와 낙천적인 것을 좋아하며 호기심이 매우 강합니<BR>다. 그러나 나서거나 잘난체하는 것을 천성적으로 싫<BR>어하는 편입니다. <BR><BR>주변 친구들이 모두 개성이 강한 편이라 해도 이런 사<BR>람은 그런 와중에서 적당히 자신을 감추는 것 같은 느<BR>낌으로 대중을 적당히 조율하는 것이 특징이라 볼 수 <BR>있습니다. ', 'M14', '94');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '장난치기를 좋아하고 농담을 나누는 것에 흥미가 많은<BR>편입니다. <BR><BR>애교스러운 점이 있어 막내 같아 보이는 점이 있지만 <BR>일이 연관되거나 혼자 있을 때는 의외의 남자다움과 <BR>강한 면모를 보여주는 다소 강인한 남성입니다. <BR>', 'M15', '95');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '엉뚱한 구석이 많은 편이라 초반부터는 이 남자에 대<BR>해 쉽게 이해가 어려울 수도 있겠습니다. <BR><BR>생각이 없는 것 같기도 하며 매사 단순하다는 듯한 느<BR>낌을 받을 수 있지만 서서히 드러나는 매력이 당신의 <BR>눈길을 끌게 될 것입니다. <BR><BR>차가운 모습 속에 감춰진 듯한 따뜻함이 유난히 매력적인 남자이기 때문입니다. ', 'M16', '96');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '잘생긴 외모에 수수한 스타일의 남자입니다. 자신의 <BR>본질적인 이야기는 되도록 하지는 않는 편이지만 대체<BR>로 솔직담백한 편입니다. <BR><BR>소탈하고 긍정적인 타입이므로 다소 심심함을 느낄 수<BR>있지만 크게 반발하는 면이 없고 여성에게 친절하기 <BR>때문에 편안한 느낌의 가정적인 배우자가 될 소지가 <BR>높습니다. ', 'M17', '97');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '보편적으로 남성다워 보이는 면이 많은 편이며 호탕한<BR>듯한 면이 잘 드러나는 편입니다. <BR><BR>다소 성급한 면을 보여주기도 하며 자신에게 냉정한 <BR>스타일로 스스로 좌절하는 것에 대해 두려울 정도의 <BR>집념을 가지고 있기도 하다고 볼 수 있습니다. <BR><BR>다만 여성에게는 성심껏 잘 하므로 당신과 잘 맞는 면<BR>을 가지고 있는 남자가 되겠습니다. ', 'M18', '98');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '남자답고 호탕한 편에 웃음소리와 목소리가 큰 편입니<BR>다. <BR><BR>활동적인 듯해 보이는 모습이 많지만 의외로 고정적인<BR>일상에서 자신의 자리를 지키는 것에 신경을 많이 쓰<BR>고 있는 남자입니다. <BR><BR>자신의 할 일에 대해서는 빈틈없이 해내는 편이지만 <BR>세심한 구석이 약한 편이어서 세세한 곳에는 당신의 <BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 손길이 필요할 것입니다. ', 'M19', '99');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '간단명료한 것을 좋아하며 복잡한 것은 되도록 멀리하<BR>고자 하는 타입입니다. <BR><BR>낙천주의자라 할만하며 영화나 음악 같은 문화적인 코<BR>드에 심취하거나 그 분야에 재능이 있는 사람이겠습니<BR>다. <BR><BR>여성에 대한 배려심이 없지는 않지만 장난이 심하거나<BR>유치함으로 인해 겉으로 잘 드러나는 편은 아니라 볼&nbsp;<BR>수 있습니다. 하지만 필요할 때에는 깊은 배려심을 보입니다. ', 'M20', '100');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '재미있고도 쾌활한 성격이 그의 부족한 외모를 충분히<BR>커버가 됩니다. <BR><BR>웬만해서는 화를 내지 않는 원만한 성격과 낙천적이며<BR>때때로 남자다운 강한 면모를 보이는 것이 매력적인 <BR>남자입니다. <BR><BR>특히 자신에게 부족한 것을 채우려 노력하는 자세는 <BR>누가 보더라도 높이 평가할만 합니다. ', 'M21', '101');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '유쾌한 면과 더불어 낙천적이면서도 다소 감정적이고 <BR>우울한 면모가 엿보이는 사람이라 볼 수 있겠습니다. <BR><BR>이와 같은 성격을 미뤄 짐작하건데 외로움을 많이 타<BR>지만 타인에게 기대지는 않는 강인한 사람입니다. <BR><BR>적응이 빨라 상황에 따라 다양한 모습이 나타나며 여<BR>러 분야에 대한 관심과 이해력이 뛰어납니다. ', 'M22', '102');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '까다로운 타입으로써 자신의 행동동선이나 개인적인<BR>프라이버시 취향에 대한 부분이 예민한 편입니다. <BR><BR>정밀함을 추구하는 기질이 있어 조립형의 모형이나 특<BR>별한 물건에 대한 수집과 같은 고상한 취미를 즐기려 <BR>하며 타인으로부터 방해받기 싫어하는 전형적인 방어<BR>형 인간이라 볼 수 있습니다. ', 'M23', '103');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '깔끔한 외모에 상대방을 제압하는 언변이 이지적이고 <BR>고상한 일면을 느끼게 할 수 있는 부분이라 볼 수 있습<BR>니다. <BR><BR>평소 생각이 많아 때때로 고심에 빠지는 일이 생기기<BR>도 합니다. 성격상 일적으로 지는 것을 싫어하기 때문<BR>에 자기계발에 관심이 많은 편입니다. ', 'M24', '104');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '남성다운 강인한 체력이나 일적인 카리스마와는 다르<BR>게 여성을 대하는 부분에서는 의외의 수줍음을 많이 <BR>타는 편입니다. <BR><BR>자신의 일에 임하는 부분에 있어서는 물러서기를 싫어<BR>하며 완벽함을 추구하는 타입의 남자라 볼 수 있습니<BR>다. <BR><BR>단점이라면 자신의 고민을 털어놓는 것을 잘 할 줄 모<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 르는 것입니다. ', 'M25', '105');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '소탈하면서 활동적인 편이기 때문에 주변에 사람이 많<BR>은 편이며 자신의 일 이외에도 다 방면의 사람들과 교<BR>류하기를 좋아하는 사람입니다. <BR><BR>그러나 상대적으로 차분한하고 꼼꼼한 일면이 부족하<BR>기 때문에 사소한 것에 대해서는 건성으로 처리하거나<BR>깜박하며 넘어가는 경우가 있으므로 중요한 날은 미리<BR>미리 알려주는 등 챙겨주는 것이 좋겠습니다. ', 'M26', '106');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '털털함의 대명사입니다. 그러한 특징은 옷차림새나 얼<BR>굴표정에서도 쉽게 드러나는 부분입니다. <BR><BR>사람을 대하는 데에 있어서도 언제나 긍정적인 마인드<BR>로 대하는 편이기에 편안한 만남을 주도하는 여유로움<BR>이 있는 것이 큰 장점입니다. <BR><BR>일상적으로 큰 문제가 될만한 부분은 없습니다. ', 'M27', '107');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '낙천적이면서도 신경질 적인 면이 있습니다. 논리적이<BR>며 수학적인 면이 있기 때문에 상황이 논리대로 마땅<BR>하다 느껴지지 않으면 이해를 하기 힘들어합니다. <BR><BR>사소한 부분까지 마음에 들 때까지 마무리를 하고 싶<BR>어 하는 근성이 있어 다소 까다로워 보이는 부분이 있<BR>지만 상대적으로 신뢰성에 대해서는 문제가 없다고 볼<BR>수 있겠습니다. ', 'M28', '108');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '때로는 귀찮을 만큼 집요한 면을 보이기도 하며 때로<BR>는 모여서 놀기를 좋아하는 호탕함을 보여줍니다. <BR><BR>때때로 까다롭기도 하며 신경질적인 듯 해 보이는 부<BR>분이 있기 때문에 종합적으로 보면 여성과 같은 면들<BR>이 많습니다. <BR><BR>실제로 주변에 여성이 많거나 잘 어울리는 모습을 볼 <BR>수 있겠습니다. ', 'M29', '109');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '참을성이 강하지만 승부욕도 강한 편이라서 매사에 적<BR>극적인 타입입니다. <BR><BR>다만 남 눈치를 보지 않는 것 같은 과격함이 약간은 외<BR>골수와 같이 보이며 제멋대로일 것 같은 이미지를 연<BR>출하기도 합니다. <BR><BR>적당한 리더쉽을 갖춘 사람이므로 당신에게 좋은 남자<BR>가 될 수 있는 자질을 갖추고 있지만 앞으로 서로의 노<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 력으로 가다듬어야 할 점이 많다고 보겠습니다. ', 'M30', '110');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '배우자의 의견을 존중하고자 하는 친절함과 자신의 일<BR>에 대한 의욕이 강한 편이기 때문에 중성적인 부드러<BR>움을 갖춘 성격이라 할 수 있습니다. <BR><BR>자기 자신의 의견을 이야기를 할 때에는 약간 어눌한 <BR>구석이 있어 다소 서툰 편이지만 딱 부러지는 행동으<BR>로 남성다운 행동패턴을 보이는 구석이 있으므로 결코<BR>약한 인물로 생각하지 않아야 합니다. ', 'M31', '111');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '놀기를 좋아하는 듯한 면이 즐거움만 추구하는 사람으<BR>로 보이기 쉽지만 알고 보면 규칙적인 생활을 통해 자<BR>신을 철저하게 관리하는 사람입니다. <BR><BR>그래서 깍듯한 면과 규칙적인 움직임이 때때로 갑갑함<BR>을 느끼게 하는 면도 있습니다. <BR><BR>특히 건강을 매우 중요시 하는 편이기 때문에 밤늦게 <BR>돌아다니는 일을 매우 싫어한다고 볼 수 있습니다. <BR>', 'M32', '112');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '약간 우수에 젓은 우울한 듯한 매력을 가진 사람으로 <BR>소심한 듯 보이기도 하지만 이야기를 나눠 보면 의외<BR>로 재미있고 여러 가지에 대한 관심이 많은 사람임을 <BR>알 수 있을 것입니다. <BR><BR>사람을 편안하게 해 주는 재주가 있지만 때때로 많은 <BR>말을 하기는 귀찮아하는 편이며 특히 애써 변명하거나<BR>같은 말을 반복하는 것을 매우 싫어합니다. ', 'M33', '113');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '활력적인 행동과 긍정적인 사고를 하기 때문에 심심한<BR>것을 잘 참지 못하는 성격입니다. <BR><BR>친구가 제법 많은 편이지만 굳이 친구에게 집착하지는<BR>않습니다. 야간 엉뚱한 편이어서 혼자 놀거나 혼자서 <BR>즐길 수 있는 개인적인 취미에 흥미를 많이 가집니다. ', 'M34', '114');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '활동적이며 사람만나는 것을 매우 좋아하는 남성다움<BR>이 풍기는 사람입니다. <BR><BR>사회활동에 우선 나서서 솔선수범하는 적극적인 자세<BR>를 가진 성격이며 타인에게 인정받기를 매우 원합니<BR>다. <BR><BR>그래서 자신이 무시당하는 것을 참지 못하는 혈기가 <BR>왕성한 타입입니다. ', 'M35', '115');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '신경질적인 듯한 반응이 없지는 않지만 보이는 외면의<BR>이미지와는 달리 그다지 공격적이거나 히스테릭하지<BR>는 않습니다. <BR><BR>단지 자기방어적인 타입이기 때문에 언뜻 공격적이어 <BR>보이는 것뿐이며 실상은 속이 여린 편이며 감성적이고<BR>외로움을 많이 타는 사람입니다. <BR><BR>약간만 잘 대해주면 금방 부드러워 지는 모습을 통해 <BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 알 수 있을 것입니다. ', 'M36', '116');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '약간 내성적인 면이 엿보이지만 동질감이 강한 사람에<BR>게 호의를 잘 베풀며 동호회중심이나 유사한 친구와 <BR>잘 어울리지만 베타적인 사람에게는 약간 신경질적인 <BR>면을 보이는 구석이 있습니다. <BR><BR>다소 게으른 면이 있지만 닥쳤을 때는 밀린 일을 한 번<BR>에 처리하는 결단력이 있기도 합니다. <BR><BR>약간 반항아적인 요소가 있기 때문에 어린 나이에는&nbsp;<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;다소의 방황이 있을 수 있습니다. ', 'M37', '117');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '쾌활하며 여유를 즐길 줄 아는 유형입니다. <BR><BR>혼자 분위기를 연출하며 바에서 칵테일을 음미하는 것<BR>부터 여러 사람과 함께 파티를 하는 것을 즐기는 부분<BR>까지 낙천적이며 호기심이 많은 성격을 보여주는 단면<BR>이라 하겠습니다. ', 'M38', '118');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '남성다운 과묵함과 함께 자기표현이 강한 타입입니<BR>다. 대체적으로 매사에 적극적이며 자기표현이 분명<BR>한 편입니다. <BR><BR>책임감은 강하지만 마음에 들지 않는 부분은 과감히 <BR>따질 줄 아는 터프한 매력의 소유자입니다. <BR><BR>이것은 교제하는 사람에게도 큰 예외 없이 적용된다고<BR>볼 수 있습니다. ', 'M39', '119');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '유순한 타입의 격의 없는 타입으로 쉽게 친해질 수 있<BR>는 편이지만 인생초반에 여자로 인해 상처를 받은 일<BR>로 연애에 관련해선 다소 여자공포증이 있을 수 있겠<BR>습니다. <BR><BR>친구까지는 허물없이 경계를 허용하지만 본질적인 사<BR>귀는 단계에서는 약간 머뭇거릴 타입입니다. <BR><BR>여러 사람과 잘 어울리는 편이며 다소 산만한 타입이<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 라 볼 수 있겠습니다. ', 'M40', '120');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '남자다운 강인한 기질을 지니고 있으면서도 고상한 취<BR>미를 즐기기 때문에 이중적인 이미지를 연출하는 모호<BR>한 사람이라 느껴지기도 합니다. <BR><BR>상황에 따라 색깔을 바꾸는 적응력이 뛰어나며 대체적<BR>으로 허물없는 편안함을 추구하는 심플한 타입입니다. ', 'M41', '121');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '깔끔함을 좋아하며 예민한 타입으로 자신에 대해 스스<BR>로 말을 많이 하지 않는 타입입니다. <BR><BR>초면에는 낯을 가리기 때문에 내성적인 기질이 보이는<BR>것이 대부분이지만 상대방과 거리감이 사라지면 장난<BR>끼가 곧잘 발동하는 타입입니다. ', 'M42', '122');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '누구나 편안하게 다가갈 수 있는 모나지 않은 성격에 <BR>유쾌한 성격을 가졌습니다. <BR><BR>걱정은 오래하기를 싫어하며 항상 좋은 일과 즐거운 <BR>일을 더 생각하고자 하는 긍정적인 타입입니다. <BR><BR>그러나 외로움을 많이 타는 편이며 감수성이 풍부하기<BR>때문에 남몰래 아픔을 견디는 면도 없지는 않겠습니<BR>다. ', 'M43', '123');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '깔끔한 편이며 대체적으로 칭찬듣기를 좋아하는 왕자<BR>와 같은 면이 다소 있습니다. <BR><BR>때로는 날카로운 칼과 같은 예리한 성격을 보이지만 <BR>상황에 따라 엉뚱한 개그를 연출할줄 아는 재미있는 <BR>사람입니다. ', 'M44', '124');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '약간은 반항적인 기질이 엿볼 수 있습니다. <BR><BR>바른생활과는 약간 거리감이 있어 보이는 옷차림을 하<BR>고 있거나 말투에서 이와 같은 성격임을 쉽게 짐작할 <BR>수 있습니다. <BR><BR>대체적으로 자유로움을 좋아하며 예술적인 감성이 높<BR>습니다. ', 'M45', '125');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '서글서글한 인상 그대로 남성다운 면과 함께 자상하고<BR>잘 챙겨주는 대범함을 갖춘 남자라 볼 수 있겠습니다. <BR><BR>다만 쓸데없이 바쁜 것이 흠이라 볼 수 있겠습니다. 적<BR>당한 요령을 모르기 때문에 사회생활에서 다소 답답한<BR>면이 있을 수 있다고 볼 수 있겠습니다. ', 'M46', '126');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '천진난만한 아기 같은 면이 있어 유치하면서도 단순한<BR>면이 있습니다. <BR><BR>금방 좋아하던 것에도 쉽게 싫증을 잘 느끼는 편이며 <BR>사소한 것에도 기분 좋게 잘 웃는 단순함이 매력 포인<BR>트이자 때로는 단점으로 느껴집니다. <BR><BR>다만 평소의 가벼워 보이는 성격과는 달리 자신의 일<BR>에 대해서는 무서운 집중력이 나타나므로 장점이 많은<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;것이 사실입니다. ', 'M47', '127');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '학문적인 분야에 대한 탐구의 열정이 있어 한 군데 몰<BR>입하면 대단한 집중력을 보여주기도 하며 일반적일 때<BR>에는 산만하기도 한 탄력적인 면이 있습니다. <BR><BR>보통은 무뚝뚝한 편이지만 여자에게는 매우 친절한 면<BR>이 있어 차가우면서도 속이 따듯한 내면의 소유자라 <BR>할 수 있겠습니다. ', 'M48', '128');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '소탈하면서 긍정적인 성향이 강한 사람이라 볼 수 있<BR>습니다. <BR><BR>나서기 싫어하는 듯하지만 대인관계는 원만하기 때문<BR>에 누구든 그를 싫어하지 않습니다. <BR><BR>보이지 않게 잘 챙겨주는 소박한 배려심이 큰 장점이<BR>며 주변사람들과 잘 융화하는 협조정신도 높게 볼 만<BR>합니다. ', 'M49', '129');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '복잡한 것 보다 단순한 것을 좋아하며 넉살이 좋은 편<BR>입니다. <BR><BR>의외로 소심한 구석이 있어 막내 같은 면이 느껴지기<BR>도 하며 주변에는 선배나 연장자가 많아 약간 주눅이 <BR>들어 보는 모습도 있습니다. <BR><BR>전반적으로 심성은 착하고 온순하다고 볼 수 있습니<BR>다. ', 'M50', '130');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '잔잔한 듯 보이지만 시간이 갈수록 유머와 넉살이 강<BR>한 편이기 때문에 의외로 매혹적으로 느껴지며 대인관<BR>계는 전반적인 분야에 고루 분포되어 있습니다. <BR><BR>처음에는 경계하는 듯하지만 천성은 사람사귀는 것을 <BR>좋아하며 가급적 교류를 통해 자신의 영역을 넓히고자<BR>하는 활동적인 사람입니다. ', 'M51', '131');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '차분하면서도 전반적인 분위기가 고고한 편이기 때문<BR>에 평소 고생을 하지 않은 사람처럼 보입니다. <BR><BR>깔끔한 것을 좋아 하며 성급하고 서두르는 것을 싫어<BR>하는 성격이어서 문화적인 부분을 느낄 수 있는 공연<BR>이나 연극 등을 즐기며 여유롭게 살아가기를 지향하는<BR>사람입니다. ', 'M52', '132');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '성격도 생긴 그대로 장난치는 것을 좋아하며 익살맞은<BR>편입니다. <BR><BR>주변엔 가까이 지내는 친구와 지인이 많은 편이므로 <BR>대인관계가 넓은 것을 알 수 있으며 대체적으로 자신<BR>의 이야기를 하기보다는 타인의 이야기를 들어주는 것<BR>을 좋아하는 여유로운 성격의 소유자입니다. ', 'M53', '133');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '낙천적이면서 여유로운 일상을 보내는 사람입니다. 자<BR>신과는 다른 생각도 포용성이 강한 성격상 많은 사람<BR>과 조화롭게 지내는 부드러운 성격의 소유자입니다. <BR><BR>몸을 움직이는 것을 좋아하며 상체가 발달한 편이기 <BR>때문에 운동을 좋아하는 남성적인 기질이 잘 살아 있<BR>는 편입니다. ', 'M54', '134');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '매사 긍정적으로 생각하는 진취적인 사람입니다. 남자<BR>다운 패기와 함께 다소 거친 매력이 돋보이는 남성입<BR>니다. <BR><BR>단체적인 생활에 적합한 편이어서 여럿이서 함께 하는<BR>것을 좋아하고 협동정신이 잘 발달된 사람이라 평할 <BR>수 있겠습니다. ', 'M55', '135');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '생긴 모습처럼 무엇이든 확실한 것을 좋아하는 타입입<BR>니다. <BR><BR>매사에 적극적이며 활동적인 기질이 남성다움을 느끼<BR>기에 충분할 것입니다. <BR><BR>그렇지만 의외로 감수성이 풍부한 편이기 때문에 문화<BR>적인 부분에서도 꽤 섬세한 취미나 기질을 엿볼 수도 <BR>있겠습니다. ', 'M56', '136');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '감상적인 편이며 여성스러운 면이 있어 중성적인 면을<BR>느낄 수 있습니다. <BR><BR>때문에 꼼꼼하며 주변사람을 잘 챙겨주는 스타일입니<BR>다. <BR><BR>깔끔한 것을 좋아하고 좋고 싫음이 분명하여 사람을 <BR>사귀거나 음식을 먹을 때 다소 가리는 것이 많은 편입<BR>니다. ', 'M57', '137');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '기본적으로 털털한 성격이지만 약간 소심한 면이 있어<BR>잘 토라지는 면이 있으며 보기와는 달리 활동적이지 <BR>않고 약간 게으른 편입니다. <BR><BR>주변사람들과 잘 어울리지만 많은 사람을 만나지는 않<BR>습니다. 번잡한 것을 싫어하기 때문에 여럿보다는 친<BR>한 사람 한 둘과의 만남만을 선호합니다. ', 'M58', '138');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '다소 여린 심성에 낙천적이며 주변 사람들과 잘 어울<BR>리지만 대체적으로 친하게 지내는 지인은 연장자들이 <BR>많아 순종형의 남성이라 볼 수 있습니다. <BR><BR>고분고분한 말씨와 행동으로 여성들과도 잘 어울리는 <BR>편입니다. <BR><BR>그다지 고집이 세지는 않으며 다소 우유부단한 면이 <BR>있어 막내와 같은 기질이 엿보인다고 할 수 있습니다. ', 'M59', '139');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '넉살이 좋은 편이기 때문에 모르는 사람과도 쉽게 잘 <BR>친해지는 편이며 활동적인 성격으로 대인관계가 넓습<BR>니다. <BR><BR>크게 가리는 것이 없는 털털한 성격이라 많은 사람이 <BR>좋아할만한 호감형의 사람입니다. <BR><BR>약간은 성급한 면이 있지만 대체로 긍정적이며 남자다<BR>운 면이 있어 높게 평할만하다고 볼 수 있습니다. <BR>', 'M60', '140');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '단순한 것을 좋아하며 복잡하거나 귀찮은 것을 싫어하<BR>는 타입입니다. <BR><BR>인생을 되도록 즐겁게 살고 싶어 하는 낙관주의자이지<BR>만 센티맨탈한 구석이 있어 조화로운 이미지가 형성되<BR>는 사람입니다. <BR><BR>대인관계는 넓은 편이며 주기적인 단체모임에도 열성<BR>적인 활동가라 볼 수 있습니다. ', 'M61', '141');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '잔잔한 성격에 솔직담백하며 상황에 따라 진지한 면이<BR>있습니다. <BR><BR>의외로 순진하기 때문에 농담과 진담을 간혹 구분하지<BR>못한다거나 농담이 통하지 않을 것 같은 웃음이 어색<BR>한 사람으로 느껴질 수 있습니다. <BR><BR>학구적이며 논리적이기 때문에 주변의 사람들도 이와 <BR>비슷한 경향이 있겠으며 생활력이 강한 것이 장점이<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;라&nbsp;볼 수 있습니다. ', 'M62', '142');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '이목구비가 뚜렷하기 때문에 확실한 느낌을 주지만 어<BR>딘가 모르게 어설프다거나 다소 우유부단한 면이 있습<BR>니다. <BR><BR>약간은 부담스러운 외모에 비해 낙관적이고 긍정적인 <BR>사고를 하므로 다가서기 편안한 성격입니다. <BR><BR>대인관계는 원만한 편이지만 약간 낯을 가리는 편이기<BR>는 합니다. ', 'M63', '143');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '생긴 것과 마찬가지로 크게 가리는 것이 없으며 즐겁<BR>게 인생을 살아가고 싶은 이상주의자이기도 합니다. <BR><BR>그런 이유로 주변 사람들이 그를 싫어하는 경우가 없<BR>이 모두 좋아합니다.<BR>&nbsp;<BR>취미활동이나 사람을 사귀는 것을 좋아하는 성격이어<BR>서 겉보기에 매우 활동적으로 보이지만 낯선 것에 대<BR>해서는 약간 거리감을 두며 일정시간의 적응이 필요<BR>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 한&nbsp;소심한 면도 있습니다. ', 'M64', '144');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '적극적이지만 말이 많지 않은 과묵함이 나타나는 성격<BR>입니다. 매사에 적극적이지만 새로운 일에 있어서는 <BR>주춤하는 보수적인 기질이 엿보입니다. <BR><BR>대체적으로 자신의 진로에 대해 신중하며 열심히 살아<BR>가는 편이라 볼 수 있겠지만 여행이나 문화적인 부분<BR>에 관심이 많은 편이기도 합니다. ', 'M65', '145');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '크게 모자란 부분은 없지만 항상 최고이기를 원하는 <BR>면이 강하기 때문에 상대적인 열등감이 다소 있으므로<BR>이런 부분으로 인해 쉽게 승부욕에 불타기도 합니다. <BR><BR>평소에는 조용조용한 성격이지만 천성은 오기가 강하<BR>기 때문에 고집스럽고 강해보이는 이미지가 다소 보이<BR>는 타입입니다. ', 'M66', '146');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '천진난만하며 철이 없어 보이거나 단순해 보이는 면이<BR>있어서 막내처럼 느껴지기도 합니다. <BR><BR>그렇지만 실제로 유약하지는 않으며 주변에 누나나 여<BR>자친구들로 인해 여성스럽게 나타나는 이미지의 효과 <BR>때문입니다. ', 'M67', '147');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '쾌활한 편이며 긍정적인 사고를 하는 타입입니다. 대<BR>인관계에 매우 적극적이며 분위기를 잘 살리는 입담이<BR>좋은 사람이라 할 수 있습니다. <BR><BR>상대방의 기분을 재빠르게 인식하는 것이 특징이라 볼<BR>수 있으며 다소 덜렁대는 듯하지만 한번 시작한 일에<BR>는 추진력이 강하고 스피드 하기 때문에 덮어놓을 만<BR>한 정도라 볼 수 있습니다. ', 'M68', '148');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '활동적인 타입에 붙임성이 좋고 예의가 바르기 때문에<BR>대체적으로 선배나 연장자로부터 귀여움을 받는 타입<BR>입니다. <BR><BR>주변사람을 잘 따르는 만큼 성실하며 노는 때에도 분<BR>위기를 잘 살리는 외향적인 성격을 가진 스타일이라 <BR>볼 수 있는 장점이 많은 사람입니다. ', 'M69', '149');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '의외로 소심한 구석이 있으며 간결하고 심플한 것을 <BR>좋아하는 소탈한 타입입니다. <BR><BR>대인관계는 대체로 원만한 편이지만 낯선 사람을 만나<BR>는 것을 그다지 즐기는 편은 아닙니다. <BR><BR>본인과 직접적으로 상관없는 사람에게는 드라이하게 <BR>대하는 냉정함도 있지만 기본적으로 다정한 성격입니<BR>다. ', 'M70', '150');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '조금은 소심한 면이 있기 때문에 낯선 것이나 급진적<BR>인 일은 별로 좋아하지 않는 편입니다. <BR><BR>하지만 천성이 유머러스하면서 싹싹하기 때문에 꽤 사<BR>교적인 면이 발달한 편이며 사람을 편하게 대하는 재<BR>주가 있는 사람입니다. ', 'M71', '151');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '외면에서 느껴지는 차분한 이미지와는 반대로 자신이 <BR>좋아하는 것에 대해서는 열정적인 면을 보이며 취미생<BR>활에 열중하는 편입니다. <BR><BR>일은 일대로 성실하며 여가생활도 주변의 여러 사람과<BR>함께하기를 좋아하는 활기 넘치는 타입의 남성이라 할<BR>수 있습니다. ', 'M72', '152');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '유머러스한 재치와 여러 사람에게 어필하는 편안함을 <BR>느낄 수 잇습니다. 때문에 주변 사람들과 더불어 분위<BR>기를 쉽게 리드하는 분위기 메이커이며 호탕하고 대인<BR>관계가 넓은 타입의 남성입니다. <BR><BR>단순하고 쉬운 것을 좋아하며 어렵고 복잡한 것을 싫<BR>어하는 스타일이라고 판단됩니다. ', 'M73', '153');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '개성이 강해보이는 이미지와는 다르게 편안하고 털털<BR>한 옆집 남자 같은 성격입니다. <BR><BR>화려해 보이는 이미지와는 다르게 소탈하며 과묵한 편<BR>이라 은은한 분위기가 매력적으로 보입니다. <BR><BR>조용한 것을 좋아하는 잔잔한 성격의 소유자라 할 수 <BR>있습니다. ', 'M74', '154');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '기본적으로 소탈하고 부드러운 타입이라 볼 수 있습니<BR>다. <BR><BR>서두르거나 경쟁하기보다는 여유를 가지고 삶에 임하<BR>는 스타일로써 낙관적인 성격의 남성입니다. <BR><BR>대인관계는 넓은 편이며 사교적이기 때문에 언변이 좋<BR>고 누구와도 쉽게 친해지는 친밀감이 장점입니다. <BR>', 'M75', '155');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '생긴 이미지에서 볼 수 있듯 웬만한 일에는 예민하게 <BR>굴지 않는 여유로움과 붙임성이 있어 대인관계가 넓고<BR>고른 것이 이 사람의 장점입니다. <BR><BR>아주 화가 나는 경우가 아니면 언성을 높이거나 타인<BR>과 시비를 하지 않으므로 온순한 성품의 소유자임을 <BR>첫인상에서도 잘 알 수 있을 것입니다. ', 'M76', '156');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '약간 차가운 성격에 예민한 편입니다. 천성은 여러 사<BR>람과 어울리는 것을 별로 좋아하지 않지만 주변에는 <BR>사람이 항상 많은 편이므로 크게 티를 내지 않는 적당<BR>히 인내심을 발휘할 줄 아는 사람입니다. <BR><BR>다만 스스로의 계획에 차질이 생기는 것을 싫어하는 <BR>완벽주의적인 면이 약간 있습니다. ', 'M77', '157');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '남자다운 확실한 면과 함께 책임감이 강하며 리더쉽이<BR>있기 때문에 매사 앞장서는 위치에 있습니다. <BR><BR>주변사람들과 융화를 잘 하는 면이 있기 때문에 단체<BR>생활에 적당하며 나이에 비해 단호한 면으로 인해 상<BR>급자에게 귀여움을 많이 받는 편입니다. ', 'M78', '158');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '외모에서 풍기는 이미지와는 다르게 일상다반사적으<BR>로 덤벙대거나 약간 어설퍼 보이는 면이 귀여움을 연<BR>출합니다. <BR><BR>공적으로는 꽤 긴장되는 이미지이긴 하지만 일을 떠난<BR>모습에선 많은 인간적인 모습을 관찰할 수 있겠으며 <BR>평소에는 여유롭고자 하는 편이기 때문에 긴박함이 없<BR>는 느긋한 모습이 대부분일 것입니다. ', 'M79', '159');insert into G005(DB_check, DB_data, DB_express, DB_num) values('N', '의젓하며 대범한 성격이며 말을 다소 아끼는 과묵한 <BR>남자입니다. <BR><BR>전반적으로 자신의 주변사람과 잘 어울리면서도 자주 <BR>혹은 지나치게 어울리는 것은 되도록 피하는 편입니<BR>다. <BR><BR>자기 관리 능력이 뛰어나며 바쁜 와중에도 개인적인 <BR>약간의 자유를 남기는 자신에게 철저한 사람입니다. <BR>', 'M80', '160');